import React from 'react';
import './Downloads.css';
import { Link } from 'react-router-dom';

const download = (props) => {
    let endpoint=``;
    return (
         endpoint=``,
        <div className="rmdb-Downloads" onClick={props.text}>

            {endpoint=`https://kickasstorrents.to/usearch/${props.movie.title}/`}
            <p>{props.text}</p>
        </div>
    )
}

export default download;
